import React from "react";

function PortfolioCard(props) {
  return (
    <div className="portfolio-card">
      <h3>{props.attributes.title}</h3>
      <div className="thumb">
        {" "}
        <img src={props.attributes.img} />
      </div>
    </div>
  );
}

export default PortfolioCard;
